import React from 'react';
import { useNavigate } from 'react-router-dom';
import homeImage from '../../assets/images/home/homeFemale.jpg';

const Home = () => {
  const navigate = useNavigate();

  const handleClick = () => {
    navigate("/login");
  };

  return (
    <div className="relative h-screen flex items-center justify-center">
      <img src={homeImage} alt="home" className="absolute inset-0 h-full w-full object-cover" />
      <div className="absolute inset-0 flex flex-col items-center justify-center text-white text-center">
        <p className="text-4xl font-bold mb-4">Campus Cohort</p>
        <p className="text-lg mb-8">A dynamic digital space dedicated to inclusive education, skill development, and peer networking. We're here to break down barriers and provide students a peer community and connections they need to thrive in their academic and professional journeys.</p>
        <button type="button" className="bg-blue-500 text-white px-4 py-2 rounded-full" onClick={handleClick}>Get Started</button>
      </div>
    </div>
  );
};

export default Home;
